import { Alert, Button } from 'reactstrap';

const index = () => {
  return (
    <div>
      <div>
        <Alert color="primary">Hello Project</Alert>
        <Button color="primary">Hello from nextjs</Button>
      </div>
    </div>
  );
};

export default index;
